import React, { useState } from 'react'

const HomeComponent = () => {
    const [loading,setLoading] = useState(false);

    if(loading){
        return <h1>Loading...</h1>
    }
  return (
    <div>
        <button onClick={()=>setLoading(true)}>Start Test</button>
    </div>
  )
}

export default HomeComponent
